class Tests < Test::Unit::TestCase

  def test_1
    assert_equal(solution('abcd'), 4)
  end

  def test_2
    assert_equal(solution('abab'), 2)
  end

  def test_3
    assert_equal(solution(''), 0)
  end

  def test_4
    assert_equal(solution('a'), 1)
  end

  def test_5
    assert_equal(solution('aabb'), 2)
  end

  def test_6
    assert_equal(solution('abcdeabcde'), 5)
  end

  def test_7
